import React from 'react';
import { Grid, Typography, TextField } from '@material-ui/core';
import Autocomplete from '@material-ui/lab/Autocomplete';
import useService from '../../hook/useService';
import useSnackbar from '../../hook/useSnackbar';

const AddEditModelTextFields = (props: any) => {
  const { values, errors, touched, handleBlur, handleChange, formikRef } = props;
  const { Post } = useService();
  const Snackbar = useSnackbar();
  const [ingredientList, setIngredientList] = React.useState([]);
  const handleBreakFastIngredient = (event: any, newValue: any) => {
    const dummyArrayData = newValue?.map((getId: any) => {
      return {
        id: getId._id,
      };
    });
    formikRef.current.setFieldValue(
      'early_morning.ingredients',
      dummyArrayData
    );
  };
  const listIngredients = async () => {
    Post('app/listAllMealIngredient', {})
      .then((res: any) => {
        if (!res.error) {
          let getequipmentList = res.data.map((data: any) => {
            data.id = data._id;
            return data;
          });
          setIngredientList(getequipmentList);
        } else {
          Snackbar.show(res.message, 'error');
        }
      })
      .catch((err: any) => {
        Snackbar.show(err.message, 'error');
      });
  };

  React.useEffect(() => {
    listIngredients();
  }, []);
  return (
    <Grid container spacing={2}>
      <Grid item xs={6}>
        <TextField
          fullWidth
          label='Goal Plan'
          name='goal_plan'
          variant='outlined'
          error={Boolean(touched.goal_plan && errors.goal_plan)}
          helperText={touched.goal_plan && errors.goal_plan}
          value={values.goal_plan}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={6}>
        <TextField
          fullWidth
          label='Activity Factor'
          name='actvity_factor'
          variant='outlined'
          error={Boolean(touched.actvity_factor && errors.actvity_factor)}
          helperText={touched.actvity_factor && errors.actvity_factor}
          value={values.actvity_factor}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={6}>
        <TextField
          fullWidth
          label='Deal Type'
          name='diet_type'
          variant='outlined'
          error={Boolean(touched.diet_type && errors.diet_type)}
          helperText={touched.diet_type && errors.diet_type}
          value={values.diet_type}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={6}>
        <TextField
          fullWidth
          label='Calories'
          name='calories'
          variant='outlined'
          error={Boolean(touched.calories && errors.calories)}
          helperText={touched.calories && errors.calories}
          value={values.calories}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>

      <Grid item xs={12}>
        <Typography variant='h5' align='center'>
          <strong>Protein</strong>
        </Typography>
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Macros'
          name='protein.macros'
          variant='outlined'
          error={Boolean(touched?.protein?.macros && errors?.protein?.macros)}
          helperText={touched?.protein?.macros && errors?.protein?.macros}
          value={values?.protein?.macros}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Gram'
          name='protein.gram'
          variant='outlined'
          error={Boolean(touched?.protein?.gram && errors?.protein?.gram)}
          helperText={touched?.protein?.gram && errors?.protein?.gram}
          value={values?.protein?.gram}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Calories'
          name='protein.calories'
          variant='outlined'
          error={Boolean(
            touched?.protein?.calories && errors?.protein?.calories
          )}
          helperText={touched?.protein?.calories && errors?.protein?.calories}
          value={values?.protein?.calories}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>

      <Grid item xs={12}>
        <Typography variant='h5' align='center'>
          <strong>Fat</strong>
        </Typography>
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Macros'
          name='fat.macros'
          variant='outlined'
          error={Boolean(touched?.fat?.macros && errors?.fat?.macros)}
          helperText={touched?.fat?.macros && errors?.fat?.macros}
          value={values?.fat?.macros}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Gram'
          name='fat.gram'
          variant='outlined'
          error={Boolean(touched?.fat?.gram && errors?.fat?.gram)}
          helperText={touched?.fat?.gram && errors?.fat?.gram}
          value={values?.fat?.gram}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Calories'
          name='fat.calories'
          variant='outlined'
          error={Boolean(touched?.fat?.calories && errors?.fat?.calories)}
          helperText={touched?.fat?.calories && errors?.fat?.calories}
          value={values?.fat?.calories}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>

      <Grid item xs={12}>
        <Typography variant='h5' align='center'>
          <strong>Carbs</strong>
        </Typography>
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Macros'
          name='carbs.macros'
          variant='outlined'
          error={Boolean(touched?.carbs?.macros && errors?.carbs?.macros)}
          helperText={touched?.carbs?.macros && errors?.carbs?.macros}
          value={values?.carbs?.macros}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Gram'
          name='carbs.gram'
          variant='outlined'
          error={Boolean(touched?.carbs?.gram && errors?.carbs?.gram)}
          helperText={touched?.carbs?.gram && errors?.carbs?.gram}
          value={values?.carbs?.gram}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Calories'
          name='carbs.calories'
          variant='outlined'
          error={Boolean(touched?.carbs?.calories && errors?.carbs?.calories)}
          helperText={touched?.carbs?.calories && errors?.carbs?.calories}
          value={values?.carbs?.calories}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>

      <Grid item xs={12}>
        <Typography variant='h5' align='center'>
          <strong>Early Morning</strong>
        </Typography>
      </Grid>
      <Grid item xs={4}>
        <Autocomplete
          multiple
          id='tags-outlined'
          options={ingredientList}
          getOptionLabel={(option: any) => option.name}
          onChange={handleBreakFastIngredient}
          renderInput={(params) => (
            <TextField
              {...params}
              variant='outlined'
              label='Select Ingredients'
              name = 'early_morning.ingredients'
              error={Boolean(
                touched?.early_morning?.ingredients &&
                  touched?.early_morning?.ingredients[0]?.id &&
                  errors?.early_morning?.ingredients &&
                  (errors?.early_morning?.ingredients[0] as any)?.id
              )}
              helperText={
                touched?.early_morning?.ingredients &&
                touched?.early_morning?.ingredients[0]?.id &&
                errors?.early_morning?.ingredients &&
                (errors?.early_morning?.ingredients[0] as any)?.id
              }
              inputProps={{
                ...params.inputProps,
              }}
            />
          )}
        />
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Quantity'
          name='early_morning.quantity'
          variant='outlined'
          error={Boolean(touched?.early_morning?.quantity && errors?.early_morning?.quantity)}
          helperText={touched?.early_morning?.quantity && errors?.early_morning?.quantity}
          value={values?.early_morning?.quantity}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Protein'
          name='early_morning.protein'
          variant='outlined'
          error={Boolean(touched?.early_morning?.protein && errors?.early_morning?.protein)}
          helperText={touched?.early_morning?.protein && errors?.early_morning?.protein}
          value={values?.early_morning?.protein}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Fat'
          name='early_morning.fat'
          variant='outlined'
          error={Boolean(touched?.early_morning?.fat && errors?.early_morning?.fat)}
          helperText={touched?.early_morning?.fat && errors?.early_morning?.fat}
          value={values?.early_morning?.fat}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Carbs'
          name='early_morning.carbs'
          variant='outlined'
          error={Boolean(touched?.early_morning?.carbs && errors?.early_morning?.carbs)}
          helperText={touched?.early_morning?.carbs && errors?.early_morning?.carbs}
          value={values?.early_morning?.carbs}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
      <Grid item xs={4}>
        <TextField
          fullWidth
          label='Calories'
          name='early_morning.calories'
          variant='outlined'
          error={Boolean(touched?.early_morning?.calories && errors?.early_morning?.calories)}
          helperText={touched?.early_morning?.calories && errors?.early_morning?.calories}
          value={values?.early_morning?.calories}
          onChange={handleChange}
          onBlur={handleBlur}
        />
      </Grid>
    </Grid>
  );
};

export default AddEditModelTextFields;
